DROP DATABASE IF EXISTS CollageMaker; -- super dangerous 
CREATE DATABASE CollageMaker;

USE CollageMaker;

CREATE TABLE Users (
	userID INT(11) PRIMARY KEY AUTO_INCREMENT,
    userName VARCHAR(100) NOT NULL,
    pw VARCHAR(100) NOT NULL,
    salt VARCHAR(100) NOT NULL
);

